import renderIndexMenu from './indexMenu';
import ProfileListItem from "./profileListItem"
import * as style from "../../css/light/searchList";
import totalToRender from "../total/totalToRender"
import { useRef } from 'react';

export default function ProfileList({listToRender, profileDataToRender, totalToRenderNumber}) {
  const listItemRef = useRef(null)

  const renderList = profileDataToRender => {
    return totalToRender(profileDataToRender, totalToRenderNumber).map((item, i) => (
      <a
          key={`ListItem${i}`}
          href={item[Object.keys(item).at(-1)]['data']}
          target="_blank"
          rel="noreferrer"
          style={{textDecoration: "none", color: "inherit"}}
      >
        <ProfileListItem key={`ListItem${i}`} ref={item} data={item}/>
      </a>
    ))
  }

  const renderListContainer = () => {
    return listToRender.map((listName, i) => (
      <div key={`ListContainer${i}`}>
        {renderIndexMenu(profileDataToRender[listName.toLowerCase()])}
        {renderList(profileDataToRender[listName.toLowerCase()])}
      </div>
    ))
  }

  return (
    <div style={style.listContainerStyle}>
      {renderListContainer()} 
    </div>
  )
}
